import './App.css';
import bg from "./assets/bg-web.png"
import logo from "./assets/logo.png"

function App() {

  const styles = {
    container: {
      backgroundImage: bg, 
      backgroundSize: "cover", 
      minHeight: "100vh" 
    },
    header: {
      display: 'flex', 
      flexDirection: "row", 
      alignItems: "center"
    },
    title: {
      color: "#FFF"
    }
  }

  return (
    <div className="App" style={styles.container}>
      <div className="header" style={styles.header}>
        <h1 style={styles.title}>FlyFair</h1>
        <img src={logo} height={100}/>
      </div>
    </div>
  );
}

export default App;
